import LogoutOnClose from "./LoginPage/LogoutOnClose.js";
import { BrowserRouter as Router } from "react-router-dom";
export default function Main() {

  return (
    <>
    <Router>
        <LogoutOnClose />
        <Home/>
  </Router>
    </>
  );
}
